import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [cities, setCities] = useState([]);
  const [selectedCity, setSelectedCity] = useState('');
  const [areas, setAreas] = useState([]);
  const [selectedArea, setSelectedArea] = useState('');
  const [condition, setCondition] = useState('');
  const [recommendations, setRecommendations] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  // Load cities on component mount
  useEffect(() => {
    loadCities();
  }, []);

  // Load areas when city changes
  useEffect(() => {
    if (selectedCity) {
      loadAreas(selectedCity);
    }
  }, [selectedCity]);

  const loadCities = async () => {
    try {
      const response = await axios.get('/api/hospitals/cities');
      setCities(response.data.cities);
    } catch (error) {
      console.error('Error loading cities:', error);
      setError('Unable to load cities. Please try again.');
    }
  };

  const loadAreas = async (city) => {
    try {
      const response = await axios.get(`/api/hospitals/areas?city=${city}`);
      setAreas(response.data.areas);
      setSelectedArea(''); // Reset area selection
    } catch (error) {
      console.error('Error loading areas:', error);
      setAreas([]);
    }
  };

  const searchHospitals = async (e) => {
    e.preventDefault();

    if (!condition.trim()) {
      setError('Please describe your medical condition');
      return;
    }

    if (!selectedCity) {
      setError('Please select a city');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const params = new URLSearchParams({
        condition: condition,
        city: selectedCity
      });

      if (selectedArea) {
        params.append('pincode', selectedArea);
      }

      const response = await axios.get(`/api/hospitals/recommend?${params}`);
      setRecommendations(response.data.recommendations);
    } catch (error) {
      console.error('Error searching hospitals:', error);
      setError('Unable to find hospitals. Please try again.');
      setRecommendations([]);
    } finally {
      setLoading(false);
    }
  };

  const handleEmergency = async () => {
    if (!selectedCity) {
      setError('Please select a city for emergency hospitals');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const response = await axios.get(`/api/hospitals/emergency?city=${selectedCity}`);
      setRecommendations(response.data.nearestHospitals.map(hospital => ({
        ...hospital,
        category: hospital.category + ' (Emergency)',
        emergencyAvailable: true
      })));
      setCondition('Emergency');
    } catch (error) {
      console.error('Error finding emergency hospitals:', error);
      setError('Unable to find emergency hospitals. Call 102 immediately.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>üè• Health-Hacker</h1>
        <p>Find hospitals anonymously across India</p>
      </header>

      <main className="App-main">
        <div className="search-container fade-in">
          <form onSubmit={searchHospitals} className="search-form">
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="city">Select City</label>
                <select
                  id="city"
                  value={selectedCity}
                  onChange={(e) => setSelectedCity(e.target.value)}
                  required
                >
                  <option value="">Choose your city...</option>
                  {cities.map((city) => (
                    <option key={city.name} value={city.name}>
                      {city.name}, {city.state}
                    </option>
                  ))}
                </select>
              </div>

              {selectedCity && areas.length > 0 && (
                <div className="form-group">
                  <label htmlFor="area">Select Area (Optional)</label>
                  <select
                    id="area"
                    value={selectedArea}
                    onChange={(e) => setSelectedArea(e.target.value)}
                  >
                    <option value="">Choose your area...</option>
                    {areas.map((area) => (
                      <option key={area.pincode} value={area.pincode}>
                        {area.area} - {area.pincode}
                      </option>
                    ))}
                  </select>
                </div>
              )}
            </div>

            <div className="form-group condition-input">
              <label htmlFor="condition">Medical Condition</label>
              <input
                type="text"
                id="condition"
                value={condition}
                onChange={(e) => setCondition(e.target.value)}
                placeholder="e.g., chest pain, fever, accident, pregnancy, eye problem..."
                required
              />
            </div>

            <div className="button-group">
              <button type="submit" disabled={loading} className="search-btn">
                {loading && <span className="loading-spinner"></span>}
                {loading ? 'Searching...' : 'Find Hospitals'}
              </button>
              <button 
                type="button" 
                onClick={handleEmergency} 
                disabled={loading}
                className="emergency-btn"
              >
                Emergency
              </button>
            </div>
          </form>

          {error && (
            <div className="error-message slide-up">
              {error}
            </div>
          )}
        </div>

        {recommendations.length > 0 && (
          <div className="results-container">
            <h2>Hospital Recommendations</h2>
            <div className="hospitals-grid">
              {recommendations.map((hospital, index) => (
                <div key={index} className="hospital-card slide-up" style={{animationDelay: `${index * 0.1}s`}}>
                  <h3>{hospital.name}</h3>
                  <div className="hospital-info">
                    <p><strong>Category:</strong> {hospital.category}</p>
                    <p><strong>Address:</strong> {hospital.address}</p>
                    {hospital.phone && (
                      <p><strong>Phone:</strong> 
                        <a href={`tel:${hospital.phone}`}>{hospital.phone}</a>
                      </p>
                    )}
                    {hospital.distance && (
                      <p><strong>Distance:</strong> {hospital.distance}</p>
                    )}
                    <p><strong>Cost:</strong> {hospital.cost}</p>
                    <p><strong>Wait Time:</strong> {hospital.waitTime}</p>
                    {hospital.emergencyAvailable && (
                      <div className="emergency-badge">24x7 Emergency</div>
                    )}
                  </div>

                  {hospital.specialties && hospital.specialties.length > 0 && (
                    <div className="specialties">
                      <strong>Specialties</strong>
                      <div className="specialty-tags">
                        {hospital.specialties.slice(0, 6).map((specialty, idx) => (
                          <span key={idx} className="specialty-tag">
                            {specialty.replace(/\\n/g, '').trim()}
                          </span>
                        ))}
                        {hospital.specialties.length > 6 && (
                          <span className="specialty-tag">
                            +{hospital.specialties.length - 6} more
                          </span>
                        )}
                      </div>
                    </div>
                  )}

                  {hospital.tips && hospital.tips.length > 0 && (
                    <div className="tips">
                      <strong>Tips</strong>
                      <ul>
                        {hospital.tips.map((tip, idx) => (
                          <li key={idx}>{tip}</li>
                        ))}
                      </ul>
                    </div>
                  )}
                </div>
              ))}
            </div>

            <div className="emergency-info slide-up">
              <h3>Emergency Numbers</h3>
              <div className="emergency-numbers">
                <a href="tel:102" className="emergency-number">
                  102 - Ambulance
                </a>
                <a href="tel:108" className="emergency-number">
                  108 - Emergency
                </a>
                <a href="tel:100" className="emergency-number">
                  100 - Police
                </a>
              </div>
            </div>
          </div>
        )}
      </main>

      <footer className="App-footer">
        <p>
          üîí Privacy-first healthcare navigation - No personal data collected
        </p>
        <p>
          For life-threatening emergencies, call 102 immediately
        </p>
      </footer>
    </div>
  );
}

export default App;
